import React from 'react';
import { useParams } from 'react-router-dom';
import './App.css'; // Import the main CSS file

function Chatbot() {
  const { mysource } = useParams();

  return (
    <div className="chatbot-container">
      {mysource === 'public' ? (
        <>
          <link rel="stylesheet" type="text/css" href="./app-public.css" />
          <iframe src={`/OAD?mysource=${mysource}`} />
        </>
      ) : (
        <>
          <link rel="stylesheet" type="text/css" href="./app-internal.css" />
          <iframe src={`/OAD?mysource=${mysource}`} />
        </>
      )}
    </div>
  );
}

export default Chatbot;
